import React from 'react';
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';

import useStyles from './About.styles';
import ProTip from '../../components/ProTip';

export default function About() {
  const classes = useStyles();
  return (
    <Grid container spacing={2} className={classes.root}>
      <Grid item xs={12} sm={12}>
        <Typography variant="body2" color="textSecondary">
          I’m a  graphic designer and art director based in Toronto, Canada.  I love to design books, art direct editorial, craft visual identities and fuss over typesetting. I apply thoughtful and well crafted conceptual design solutions to every project. I wholeheartedly believe that if you work really hard and are kind, amazing things will happen.* I’m currently the Design Director at The Office of Gilbert Li.
        </Typography>
        <ProTip />
      </Grid>
      <Grid item xs={12} sm={6}>
      </Grid>
      <Grid item xs={12} sm={6}>
        <Typography variant="body2" color="textSecondary">
          I’m a  graphic designer and art director based in Toronto, Canada.  I love to design books, art direct editorial, craft visual identities and fuss over typesetting. I apply thoughtful and well crafted conceptual design solutions to every project. I wholeheartedly believe that if you work really hard and are kind, amazing things will happen.* I’m currently the Design Director at The Office of Gilbert Li.
        </Typography>
      </Grid>
    </Grid>
  );
}
